class ContaoCommunityAlliance_Composer_Check_PHPMemoryLimitCheck implements ContaoCommunityAlliance_Composer_Check_CheckInterface {  public function run() { $memoryLimit = trim(ini_get('memory_limit')); if ($memoryLimit == -1) { $memoryLimitHumanReadable = $this->bytesToHumandReadable($memoryLimit); $state = ContaoCommunityAlliance_Composer_Check_StatusInterface::STATE_OK; $summary = Runtime::$translator->translate( 'php_memory_limit', 'summary_unlimited', array('%memory_limit%' => $memoryLimitHumanReadable) ); $description = Runtime::$translator->translate( 'php_memory_limit', 'description_unlimited', array('%memory_limit%' => $memoryLimitHumanReadable) ); } else { $memoryLimit = $this->memoryInBytes($memoryLimit); $memoryLimitHumanReadable = $this->bytesToHumandReadable($memoryLimit); if ( function_exists('ini_set') && @ini_set('memory_limit', '1024M') !== false && ini_get('memory_limit') == '1024M' ) { $state = ContaoCommunityAlliance_Composer_Check_StatusInterface::STATE_OK; $summary = Runtime::$translator->translate( 'php_memory_limit', 'summary_increased', array('%memory_limit%' => '1024 MiB') ); $description = Runtime::$translator->translate( 'php_memory_limit', 'description_increased', array('%memory_limit%' => '1024 MiB') ); } else if ($memoryLimit >= 1024 * 1024 * 1024) { $state = ContaoCommunityAlliance_Composer_Check_StatusInterface::STATE_OK; $summary = Runtime::$translator->translate( 'php_memory_limit', 'summary_good', array('%memory_limit%' => $memoryLimitHumanReadable) ); $description = Runtime::$translator->translate( 'php_memory_limit', 'description_good', array('%memory_limit%' => $memoryLimitHumanReadable) ); } else if ($memoryLimit >= 512 * 1024 * 1024) { $state = ContaoCommunityAlliance_Composer_Check_StatusInterface::STATE_OK; $summary = Runtime::$translator->translate( 'php_memory_limit', 'summary_okay', array('%memory_limit%' => $memoryLimitHumanReadable) ); $description = Runtime::$translator->translate( 'php_memory_limit', 'description_okay', array('%memory_limit%' => $memoryLimitHumanReadable) ); } else { $state = ContaoCommunityAlliance_Composer_Check_StatusInterface::STATE_WARNs; $summary = Runtime::$translator->translate( 'php_memory_limit', 'summary_low', array('%memory_limit%' => $memoryLimitHumanReadable) ); $description = Runtime::$translator->translate( 'php_memory_limit', 'description_low', array('%memory_limit%' => $memoryLimitHumanReadable) ); } } return new ContaoCommunityAlliance_Composer_Check_Status( 'php_memory_limit', $state, $summary, $description ); } protected function memoryInBytes($value) { $unit = strtolower(substr($value, -1, 1)); $value = (int) $value; switch ($unit) { case 'g': $value *= 1024;  case 'm': $value *= 1024;  case 'k': $value *= 1024; } return $value; } protected function bytesToHumandReadable($bytes) { if ($bytes == -1) { return '∞'; } $unit = ''; if ($bytes >= 1024) { $unit = ' kiB'; $bytes /= 1024; } if ($bytes >= 1024) { $unit = ' MiB'; $bytes /= 1024; } if ($bytes >= 1024) { $unit = ' GiB'; $bytes /= 1024; } return round($bytes) . $unit; } }
class ContaoCommunityAlliance_Composer_Check_PHPProcOpenCheck implements ContaoCommunityAlliance_Composer_Check_CheckInterface {  public function run() { $disabledFunctions = explode(',', ini_get('disable_functions')); $disabledFunctions = array_map('trim', $disabledFunctions); if (function_exists('proc_open') && !in_array('proc_open', $disabledFunctions)) { $state = ContaoCommunityAlliance_Composer_Check_StatusInterface::STATE_OK; $summary = Runtime::$translator->translate('php_proc_open', 'summary_supported'); $description = Runtime::$translator->translate('php_proc_open', 'description_supported'); } else { $state = ContaoCommunityAlliance_Composer_Check_StatusInterface::STATE_WARN; $summary = Runtime::$translator->translate('php_proc_open', 'summary_unsupported'); $description = Runtime::$translator->translate('php_proc_open', 'description_unsupported'); } return new ContaoCommunityAlliance_Composer_Check_Status( 'php_proc_open', $state, $summary, $description ); } }
